import json, requests, chardet

def task_func(url="http://api.example.com/data", from_encoding=None, to_encoding="utf8"):
    response = requests.get(url, timeout=5)
    content = response.content
    if not content: return {}
    detected_encoding = chardet.detect(content)['encoding']
    if not detected_encoding: raise ValueError("Unable to detect encoding for non-empty content")
    decoded_content = content.decode(detected_encoding)
    encoded_content = decoded_content.encode(to_encoding)
    return json.loads(encoded_content)

import struct, io, gzip

def task_func(newArray):
