import numpy as np
from scipy.stats import norm

def task_func(data: np.ndarray, threshold: float = 2.0) -> list:
    mean = np.mean(data)
    var = np.var(data)
    if var == 0:
        return [], mean, var
    z_scores = (data - mean) / np.sqrt(var)
    outliers = np.where(np.abs(z_scores) > threshold)[0].tolist()
    return outliers, mean, var

