import pandas as pd

def task_func(l, n_groups=5):
    shuffle(l)
    series = []
    for _ in range(len(l)*2):
        element = l[len(series)%len(l)]
        if isinstance(element, str):
            move = randint(1, n_groups)
            modified = element[move:]+element[:move]
        else:
            modified = element
        series.append(modified)
    return pd.Series(series)
